speaker_wavs = [wav[int(s[0] * sampling_rate):int(s[1]) * sampling_rate] for s in segments]
  
    
## Compare speaker embeds to the continuous embedding of the interview
# Derive a continuous embedding of the interview. We put a rate of 16, meaning that an 
# embedding is generated every 0.0625 seconds. It is good to have a higher rate for speaker 
# diarization, but it is not so useful for when you only need a summary embedding of the 
# entire utterance. A rate of 2 would have been enough, but 16 is nice for the sake of the 
# demonstration. 
# We'll exceptionally force to run this on CPU, because it uses a lot of RAM and most GPUs 
# won't have enough. There's a speed drawback, but it remains reasonable.
encoder = VoiceEncoder("cpu")
print("Running the continuous embedding on cpu, this might take a while...")
_, cont_embeds, wav_splits = encoder.embed_utterance(wav, return_partials=True, rate=16)

#print(wav_splits)
# Get the continuous similarity for every speaker. It amounts to a dot product between the 
# embedding of the speaker and the continuous embedding of the interview
speaker_embeds = [encoder.embed_utterance(speaker_wav) for speaker_wav in speaker_wavs]
similarity_dict = {name: cont_embeds @ speaker_embed for name, speaker_embed in 
                   zip(speaker_names, speaker_embeds)}

mydict={}
## Run the interactive demo
interactive_diarization(similarity_dict, wav, wav_splits)

def get_max(mdict,prev,curr):
    newdict={}
    #[value for key, value in mdict.items() if key => mdict[prev] and key<=mdict[curr]]
    for key, value in mdict.items():
        if float(key) >=float(prev) and float(key)<=float(curr):
            if value not in newdict:
                newdict[value]=1
            else:
                newdict[value]+=1
    sorted_d = dict(sorted(newdict.items(), key=operator.itemgetter(1),reverse=True))
    return list(sorted_d.keys())[0]
    

def getvoice(duration,mydict):
    curr=list(mydict.keys())[0]
    prev=curr
    speakerarray=[]
    for arr in duration:
        st= (arr[1]*1000 + arr[2]/1000000)/1000
        et= (arr[3]*1000 + arr[4]/1000000)/1000
        durr = et-st-2.4
        for i,e in enumerate(mydict.keys()):
            
            if float(curr)+float(durr) < float(e):
                #print(curr,durr,curr+durr, prev, e)
                curr=float(e)
                speakerarray.append(get_max(mydict,prev,curr))
                prev=curr
    newspeaker=list()
    for i,e in enumerate(speakerarray):
        if i == len(speakerarray)-1:
            newspeaker.append(speakerarray[i])
            break
        if speakerarray[i]!=speakerarray[i+1]:
            newspeaker.append(speakerarray[i])
    newspeaker.append('ram')
    newspeaker.append('pad')

    return newspeaker
